"2011500160" is silkscreened on the board in the FCC photos.
A '''MTK''' WiFi chip is presumed to be used on it's appearance and platform usage. {{See also|TP-LINK TD-W8951ND v6|TP-LINK}}
The SoC used in this device looks like a RT63363E from the FCC photos, :but it may instead be a RT63365E.
===Probable included PSU=== The power supply shown in the FCC docs is a '''TP-LINK''' branded T090060-2B1.
